use std::path::Path;
use base64::Engine;
use base64::engine::general_purpose::STANDARD_NO_PAD;
use once_cell::sync::Lazy;
use crate::common::get_root;

const SEVEN_ZIP_FILE: &str = r#""#;

static SEVEN_ZIP_FILENAME: Lazy<Box<Path>> = Lazy::new(|| {
    let root = get_root();
    root.join("7zr.exe").into_boxed_path()
});

pub fn ensure_seven_zip() -> &'static Path {
    let path = SEVEN_ZIP_FILENAME.as_ref();
    if path.is_file() {
        return path;
    }
    std::fs::write(path, STANDARD_NO_PAD.decode(SEVEN_ZIP_FILE).unwrap().as_slice()).unwrap();
    path
}